import React from 'react';
import { useNavigate } from 'react-router-dom';
import { ReactComponent as BackIcon } from '../other/backarrow.svg'; // Make sure to import your back arrow icon

const BackButton = () => {
    let navigate = useNavigate();

    const goBack = () => {
        navigate(-1); // This will take the user to the previous page in history
    };

    return (
        <button onClick={goBack} style={{ border: 'none', background: 'none', cursor: 'pointer' }}>
            <BackIcon /> {/* This is your back arrow icon */}
        </button>
    );
};

export default BackButton;
